import React from 'react';
import styled from 'styled-components';

const SideBar: React.FC = () => {
    return (
        <>
        <Container>
             SIDEBAR
        </Container>
        <Test>
            MAINDISPLAY
        </Test>
        </>
    )
}

export default SideBar;

const Container = styled.div`
    position: absolute;
    top: 10px;
    left: 10px;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    width: 25%;
    height: 98%;
    border-radius: 30px;
    background-color: ${({ theme }) => theme.colors.black20};
`;

const Test = styled.div`
position: absolute;
    top: 10px;
    right: 10px;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    width: 72%;
    height: 98%;
    border-radius: 30px;
    background-color: ${({ theme }) => theme.colors.black20};
`;
